import React from 'react';
import { Box, Typography } from '@mui/material';

const ServicesPage = () => {
  return (
    <Box sx={{ padding: 4 }}>
      <Typography variant="h4" gutterBottom>
        Наши услуги
      </Typography>
      <Typography variant="body1" paragraph>
        Мы предоставляем услуги по разработке и настройке ПО для кассовых аппаратов, а также консультируем и обучаем ваших сотрудников.
      </Typography>
    </Box>
  );
};

export default ServicesPage;
